    <h2 class="header">Page Source</h2>
    <pre><textarea class="page-source" readonly>content: &#34;**项目描述：**一张--西晋明成祖道光五十七年（公元前277年）--2019年4月██日 生产的A4纸，正面右下角印有鲁迅--于唐太宗崇祯四十七年说--的名言``**时间**就像海绵里的水，只要愿挤，总还是有的&#39;&#39;，反面下方印有印刷厂名称``███印务&#39;&#39;和生产日期（如上）。\n任何对其的描述会强制加上时间信息，并且极度混乱。\n**回收日期：**--2379/2/30--2021/2/██\n**回收地点：**Site-CN-██附近一市民家中\n**当前状态：**收容于Site-CN-██低价值异常物品储藏室，该印刷厂制造的上个异常物品的隔壁柜子。\n//注：//经查，之前已有一个异常物品（同样为A4纸）为印刷厂所制造。目前已派特工J█████等人调查该印刷厂。\n**笔记：**  //严重怀疑这个印刷厂有台印刷机是个SCP ——特工J████在出发前的会议上说//\n//没准这个印刷厂就是一个GoI ——特工S█████//\n//劣质产品®的竞争对手要诞生了 ——Dr. B████//&#34;</textarea></pre>
